    height: 100vh;
    display: flex;
    color: white;
  }
  
  .appAside {
    width: 50%;
    background-color: #6b5b95;
  }
  
  .appForm {
    width: 50%;
    background-color: #12130f;
    padding: 25px 40px;
    overflow: auto;
  }
  
  .pageSwitcher {
    display: flex;
    justify-content: flex-end;
    margin-bottom: 10%;
  }
  
  .pageSwitcherItem {
    background-color: #40434e;
    color: #9da6b1;
    padding: 10px 25px;
    cursor: pointer;
    font-size: 0.9em;
    border: none;
    outline: none;
    display: inline-block;
    text-decoration: none;
  }
  
  .pageSwitcherItem-active {
    background-color: #6b5b95;
    color: white;
  }
  
  .pageSwitcherItem:first-child {
    border-top-left-radius: 25px;
    border-bottom-left-radius: 25px;
  }
  .pageSwitcherItem:last-child {
    border-top-right-radius: 25px;
    border-bottom-right-radius: 25px;
  }

.formCenter {
    margin-bottom: 100px;
  }
  
  .formTitle {
    color: #707c8b;
    font-weight: 300;
    margin-bottom: 50px;
  }
  
  .formTitleLink {
    color: #707c8b;
    text-decoration: none;
    display: inline-block;
    font-size: 1.7em;
    margin: 0 10px;
    padding-bottom: 5px;
  }
  
  .formTitleLink:first-child {
    margin-left: 0;
  }
  
  .formTitleLink-active {
    color: white;
    border-bottom: 1px solid #6b5b95;
  }
  
  .formField {
    margin-bottom: 40px;
  }
  
  .formFieldLabel {
    display: block;
    text-transform: uppercase;
    font-size: 0.9em;
    color: white;
  }
  .formFieldInput {
    width: 85%;
    background-color: transparent;
    border: none;
    color: white;
    outline: none;
    border-bottom: 1px solid #445366;
    font-size: 1em;
    font-weight: 300;
    padding-bottom: 10px;
    margin-top: 10px;
  }
  
  .formFieldInput::placeholder {
    color: #616e7f;
  }
  
  .formFieldButton {
    background-color: #6b5b95;
    color: white;
    border: none;
    outline: none;
    border-radius: 25px;
    padding: 15px 70px;
    font-size: 0.8em;
    font-weight: 500;
  }
  
  .formFieldLink {
    color: #66707d;
    text-decoration: none;
    display: inline-block;
    border-bottom: 1.5px solid #6b5b95;
    padding-bottom: 5px;
  }
  
  .formFieldCheckboxLabel {
    color: #646f7d;
    font-size: 0.9em;
  }
  
  .formFieldCheckbox {
    position: relative;
    top: 1.5px;
  }
  
  .formFieldTermsLink {
    color: white;
    border-bottom: 1px solid #6b5b95;
    text-decoration: none;
    display: inline-block;
    padding-bottom: 2px;
    margin-left: 5px;

 .navbar {
    background: linear-gradient(90deg, rgb(28, 27, 27) 0%, rgb(26, 23, 23) 100%) !important;
    height: 80px !important;
    display: flex !important;
    justify-content: center !important;
    align-items: center !important;
    font-size: 1.2rem !important;
  }
  
  .navbar-logo {
    color: #fff !important;
    justify-self: start !important;
    margin-left: 20px !important;
    cursor: pointer !important;
    text-decoration: none !important;
    font-size: 2rem !important;
  }
  

  
  .nav-menu {
    display: grid !important;
    grid-template-columns: repeat(5, auto) !important;
    grid-gap: 10px !important;
    list-style: none !important;
    text-align: center !important;
    width: 70vw !important;
    justify-content: end !important;
    margin-right: 2rem !important;
  }
  
  .nav-item {
    display: flex !important;
    height: 80px !important;
  }
  .padding{
    padding-top: 1rem !important;
  }
  
  .nav-links {
    color: white !important;
    text-decoration: none !important;
    padding: 0.5rem 1rem !important;
  }
  
  .nav-links:hover {
    background-color: #1888ff !important;
    border-radius: 4px !important;
    transition: all 0.2s ease-out !important;
  }
  
  .fa-bars {
    color: #fff !important;
  }
  
  .nav-links-mobile {
    display: none !important;
  }
  
  .menu-icon {
    display: none !important;
  }
  
  @media screen and (max-width: 1092px) {
    .fa-caret-down{
      display: none !important;
    }
    .NavbarItems {
      position: relative !important;
    }
  
    .nav-menu {
      display: flex !important;
      flex-direction: column !important;
      width: 100% !important;
      position: absolute !important;
      top: 80px !important;
      left: -100% !important;
      opacity: 1 !important;
      transition: all 0.5s ease !important;
    }
  
    .nav-menu.active {
      background: #242222 !important;
      left: 0 !important;
      opacity: 1 !important;
      transition: all 0.5s ease !important;
      z-index: 1 !important;
    }
  
    .nav-links {
      text-align: center !important;
      padding: 2rem !important;
      width: 100% !important;
      display: table !important;
    }
  
    .nav-links:hover {
      background-color: #1888ff !important;
      border-radius: 0 !important;
    }
  
    .navbar-logo {
      position: absolute !important;
      top: 0 !important;
      left: 0 !important;
      transform: translate(25%, 50%) !important;
    }
  
    .menu-icon {
      display: block !important;
      position: absolute !important;
      top: 0 !important;
      right: 0 !important;
      transform: translate(-100%, 60%) !important;
      font-size: 1.8rem !important;
      cursor: pointer !important;
    }
  
    .fa-times {
      color: #fff !important;
      font-size: 2rem !important;
    }
  
    .nav-links-mobile {
      display: block !important;
      text-align: center !important;
      padding: 1.5rem !important;
      margin: 2rem auto !important;
      border-radius: 4px !important;
      width: 80% !important;
      background: #1888ff !important;
      text-decoration: none !important;
      color: #fff !important;
      font-size: 1.5rem !important;
    }
  
    .nav-links-mobile:hover {
      background: #fff !important;
      color: #1888ff !important;
      transition: 250ms !important;
    }
  
    button {
      display: none !important;
    }
  }
